import "./Contact.css";

export default function Contact() {
  return (
    <div className="Contact">
      <div className="container">
        <form>
          <h3> GET IN TOUCH!</h3>
          <input type="text" placeholder="Your Name" required></input>
        </form>
      </div>
    </div>
  );
}
